import { BrowserRouter, Routes, Route } from "react-router-dom";
//import Menu from "./components/Menu";
//import Poses from "./components/Poses";
import Guru from "./pages/Guru";
import Home from "./pages/Home";
//import Lineage from "./components/Homes";
import LineageShow from "./pages/LineageShow";
import Poses from "./pages/Poses";
import Menu from "./pages/Menu";


function App() {
  return (
    <BrowserRouter>
      <Menu />
      <Routes>
       <Route path="about/LineageShow" element={<LineageShow />} />
      </Routes>
      <Routes>
      <Route path="/" element={<Home />} />
      </Routes>
      <Routes>
        <Route path="/learn/asanas" element={<Poses />} />
      </Routes>
      <Routes>
        <Route path="/about/Guru" element={<Guru />} />
      </Routes>
      <Routes>
       <Route path="/poses" element={<Poses />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
